define('text!app.html', ['module'], function(module) { module.exports = "<template>\r\n  <compose view=\"../glyphs/icomoon.svg\"></compose>\r\n  <compose view=\"../glyphs/hawcons-linear.svg\"></compose>\r\n  <compose view=\"../glyphs/hawcons-filled.svg\"></compose>\r\n  <ui-viewport dir.bind=\"currentLocale=='ar'?'rtl':'ltr'\">\r\n    <ui-app-header>\r\n      <ui-drawer-toggle drawer.bind=\"menuDrawer\"></ui-drawer-toggle>\r\n      <ui-app-title src=\"images/logo.png\">\r\n        <h6>\r\n          <span t=\"common:title\"></span>\r\n          <small t=\"subtitle\"></small>\r\n        </h6>\r\n      </ui-app-title>\r\n      <ui-filler></ui-filler>\r\n      <div class=\"ui-text-end ui-pad-all\">\r\n        <div class=\"indicator ui-bg-primary\"></div>\r\n        <div class=\"indicator ui-bg-secondary\"></div>\r\n        <div class=\"indicator ui-bg-info\"></div>\r\n        <div class=\"indicator ui-bg-danger\"></div>\r\n        <div class=\"indicator ui-bg-success\"></div>\r\n        <div class=\"indicator ui-bg-warning\"></div>\r\n\r\n        <div>\r\n          <ui-dropdown class=\"ui-text-start\" value.bind=\"currentLocale\" change.trigger=\"updateLocale()\">\r\n            <ui-list-item glyph=\"ui-flag GB\" value=\"en\">English</ui-list-item>\r\n            <ui-list-item glyph=\"ui-flag ES\" value=\"es\">Spanish</ui-list-item>\r\n            <ui-list-item glyph=\"ui-flag AE\" value=\"ar\">Arabic</ui-list-item>\r\n          </ui-dropdown>\r\n        </div>\r\n      </div>\r\n    </ui-app-header>\r\n\r\n    <ui-drawer ref=\"menuDrawer\" scroll close-on-click>\r\n      <a href=\"#/\" class=\"ui-block\">\r\n        <fieldset class=\"menu-banner\">\r\n          <ui-row middle>\r\n            <img src=\"images/logo.png\" height=\"48\"/>\r\n            <ui-column fill class=\"ui-font-big\">\r\n              <strong t=\"title\"></strong>\r\n              <div class=\"ui-font-small\">\r\n                <span t=\"[prepend]version\">\r\n                  ${constants.App.Version}</span>\r\n              </div>\r\n            </ui-column>\r\n          </ui-row>\r\n        </fieldset>\r\n      </a>\r\n      <ui-menu>\r\n        <ui-menu-group label.bind=\"routes.key & t\" repeat.for=\"routes of router.navigation | group:'settings.section'\">\r\n          <ui-menu-item repeat.for=\"route of routes.items\" href.bind=\"route.href\" active.bind=\"route.isActive\" icon.bind=\"route.settings.icon\" disabled.bind=\"route.settings.disabled\">${route.settings.title || route.title & t}</ui-menu-item>\r\n        </ui-menu-group>\r\n      </ui-menu>\r\n    </ui-drawer>\r\n\r\n    <ui-router-view></ui-router-view>\r\n    <ui-app-footer>\r\n      <span t=\"[prepend]version\">${constants.Version}</span>\r\n      <span>&copy; 2017, Adarsh Pastakia</span>\r\n    </ui-app-footer>\r\n  </ui-viewport>\r\n</template>\r\n"; });
define('text!api/app.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Application\" animate>\r\n    <ui-content scroll padded>\r\n      <ui-container class=\"ui-markdown\">\r\n        <h5 class=\"section-title\">Class: UIApplication</h5>\r\n        <p>Singleton class with common application properties and methods</p>\r\n        <pre mdview=\"ts\">\r\n          import {autoinject} from \"aurelia-framework\";\r\n          import {UIApplication} from \"aurelia-ui-framework\";\r\n\r\n          @autoinject()\r\n          export class PageView {\r\n            constructor(public app:UIApplication){}\r\n          }\r\n        </pre>\r\n\r\n        <p class=\"ui-strong\">Properties</p>\r\n        <ul>\r\n          <li>\r\n            <code>constants:UIConstants</code>\r\n          </li>\r\n          <p></p>\r\n\r\n          <li>\r\n            <code>Authenticated:bool</code>\r\n          </li>\r\n          <p>Boolean indicator</p>\r\n\r\n          <li>\r\n            <code>AuthUser:string</code>\r\n          </li>\r\n          <p>Authenticated user to use when sending authentication header for Http Client</p>\r\n\r\n          <li>\r\n            <code>AuthToken:string</code>\r\n          </li>\r\n          <p>Authenticated token to use when sending authentication header for Http Client</p>\r\n        </ul>\r\n        <br/>\r\n        <p class=\"ui-strong\">Methods</p>\r\n        <ul>\r\n          <li>\r\n            <code>login(user:UserModel, route?:name)</code>\r\n          </li>\r\n          <div innerhtml.bind=\"userModel | markdown\"></div>\r\n          <pre mdview=\"ts\">\r\n            UserModel {\r\n              username:string;\r\n              password:string;\r\n              token:string;\r\n            }\r\n          </pre>\r\n\r\n          <li>\r\n            <code>logout()</code>\r\n            <p></p>\r\n          </li>\r\n          <div class=\"note\">Both\r\n            <em>login</em>,\r\n            <em>logout</em>\r\n            methods will broadcast the following events\r\n            <code>auf:login</code>,\r\n            <code>auf:logout</code>\r\n          </div>\r\n          <br/>\r\n          <li>\r\n            <code>toast(message:string | ToastConfig, container?:HTMLElement)</code>\r\n          </li>\r\n          <li>\r\n            <code>toastSuccess(message:string | ToastConfig, container?:HTMLElement)</code>\r\n          </li>\r\n          <li>\r\n            <code>toastError(message:string | ToastConfig, container?:HTMLElement)</code>\r\n          </li>\r\n          <div class=\"note\">Pass a container element to create inline toast within the page</div>\r\n          <pre mdview=\"ts\">\r\n            ToastConfig {\r\n              title:string;\r\n              message:string;\r\n              glyph:string;\r\n              theme:string;\r\n              timeout:number; // 0 disable auto-hide\r\n            }\r\n          </pre>\r\n\r\n          <br/>\r\n          <li>\r\n            <code>alert(message:string | AlertConfig):Promise&lt;bool></code>\r\n          </li>\r\n          <li>\r\n            <code>confirm(message:string | AlertConfig):Promise&lt;bool></code>\r\n          </li>\r\n          <li>\r\n            <code>prompt(message:string | AlertConfig):Promise&lt;string></code>\r\n          </li>\r\n          <pre mdview=\"ts\">\r\n            AlertConfig {\r\n              title:string;\r\n              message:string;\r\n              glyph:string;\r\n              okLabel:string;\r\n              cancelLabel:string;\r\n            }\r\n          </pre>\r\n\r\n          <br/>\r\n          <li>Data Sharing\r\n            <ul>\r\n              <li>Instance sharing\r\n                <ul>\r\n                  <li>\r\n                    <code>shared(key:string)</code>\r\n                    get shared property</li>\r\n                  <li>\r\n                    <code>shared(key:string, val:any)</code>\r\n                    set shared property</li>\r\n                  <li>\r\n                    <code>shared(key:string, null)</code>\r\n                    delete shared property</li>\r\n                </ul>\r\n              </li>\r\n\r\n              <li>Session sharing, uses browser\r\n                <em>sessionStorage</em>\r\n                <ul>\r\n                  <li>\r\n                    <code>session(key:string)</code>\r\n                    get session property</li>\r\n                  <li>\r\n                    <code>session(key:string, val:any)</code>\r\n                    set session property</li>\r\n                  <li>\r\n                    <code>session(key:string, null)</code>\r\n                    delete session property</li>\r\n                </ul>\r\n              </li>\r\n\r\n              <li>Persistent sharing, uses browser\r\n                <em>localStorage</em>\r\n                <ul>\r\n                  <li>\r\n                    <code>persist(key:string)</code>\r\n                    get persistent property</li>\r\n                  <li>\r\n                    <code>persist((key:string, val:any)</code>\r\n                    set persistent property</li>\r\n                  <li>\r\n                    <code>persist((key:string, null)</code>\r\n                    delete persistent property</li>\r\n                </ul>\r\n              </li>\r\n            </ul>\r\n          </li>\r\n\r\n          <br/>\r\n          <li>Logging\r\n            <ul>\r\n              <li>\r\n                <code>info(tag:string, message:string, ...rest:any)</code>\r\n              </li>\r\n              <li>\r\n                <code>warn(tag:string, message:string, ...rest:any)</code>\r\n              </li>\r\n              <li>\r\n                <code>error(tag:string, message:string, ...rest:any)</code>\r\n              </li>\r\n              <li>\r\n                <code>debug(tag:string, message:string, ...rest:any)</code>\r\n              </li>\r\n            </ul>\r\n          </li>\r\n        </ul>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!api/view.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-section row-layout animate>\r\n    <ui-sidebar label=\"API Classes\" collapsible scroll>\r\n      <ui-menu>\r\n        <ui-menu-item repeat.for=\"route of router.navigation\" href.bind=\"route.href\" active.bind=\"route.isActive\" icon.bind=\"route.settings.icon\" disabled.bind=\"route.settings.disabled\">${route.settings.title || route.title}</ui-menu-item>\r\n      </ui-menu>\r\n    </ui-sidebar>\r\n    <ui-router-view></ui-router-view>\r\n  </ui-section>\r\n</template>\r\n"; });
define('text!components/alerts.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Alerts\" animate>\r\n    <ui-content scroll padded>\r\n      <ui-container>\r\n        <h5 class=\"section-title\">Toast Messages</h5>\r\n        <div ref=\"alertHolder\"></div>\r\n        <ui-fieldset legend=\"Toasts\">\r\n          <ui-row>\r\n            <ui-column fill padded>\r\n              <ui-input-group>\r\n                <ui-input-label>Title</ui-input-label>\r\n                <ui-input value.bind=\"toast.title\" clear></ui-input>\r\n              </ui-input-group>\r\n            </ui-column>\r\n            <ui-column fill padded>\r\n              <ui-input-group>\r\n                <ui-input-label>Message</ui-input-label>\r\n                <ui-input value.bind=\"toast.message\"></ui-input>\r\n              </ui-input-group>\r\n            </ui-column>\r\n          </ui-row>\r\n          <ui-row>\r\n            <ui-column fill padded>\r\n              <ui-option-group name=\"theme\" value.bind=\"toast.theme\" cols=\"4\">\r\n                <ui-input-label>Theme</ui-input-label>\r\n                <ui-radio value=\"light\">Light</ui-radio>\r\n                <ui-radio value=\"dark\">Dark</ui-radio>\r\n                <ui-radio value=\"primary\">Primary</ui-radio>\r\n                <ui-radio value=\"secondary\">Secondary</ui-radio>\r\n                <ui-radio value=\"info\">Info</ui-radio>\r\n                <ui-radio value=\"danger\">Danger</ui-radio>\r\n                <ui-radio value=\"success\">Success</ui-radio>\r\n                <ui-radio value=\"warning\">Warning</ui-radio>\r\n              </ui-option-group>\r\n            </ui-column>\r\n            <ui-column fill padded>\r\n              <ui-input-group plain>\r\n                <ui-input-label>Glyph</ui-input-label>\r\n                <ui-dropdown value.bind=\"toast.glyph\" width=\"8em\">\r\n                  <ui-list-item value=\"\">None</ui-list-item>\r\n                  <ui-list-item value=\"glyph-alert-info\" glyph=\"glyph-alert-info\">Info</ui-list-item>\r\n                  <ui-list-item value=\"glyph-alert-exclaim\" glyph=\"glyph-alert-exclaim\">Exclaim</ui-list-item>\r\n                  <ui-list-item value=\"glyph-alert-question\" glyph=\"glyph-alert-question\">Question</ui-list-item>\r\n                  <ui-list-item value=\"glyph-alert-error\" glyph=\"glyph-alert-error\">Error</ui-list-item>\r\n                </ui-dropdown>\r\n              </ui-input-group>\r\n\r\n              <ui-input-group width=\"8em\">\r\n                <ui-input-label>Timeout</ui-input-label>\r\n                <ui-input number.bind=\"toast.timeout\"></ui-input>\r\n              </ui-input-group>\r\n            </ui-column>\r\n          </ui-row>\r\n          <ui-toolbar>\r\n            <ui-button light small click.trigger=\"toastAlert()\">Viewport Toast</ui-button>\r\n            <ui-button light small click.trigger=\"inlineToast()\">Inline Toast</ui-button>\r\n          </ui-toolbar>\r\n        </ui-fieldset>\r\n        <hr/>\r\n        <h5 class=\"section-title\">Alert Dialogs</h5>\r\n        <ui-fieldset legend=\"Toasts\">\r\n          <ui-row>\r\n            <ui-column fill padded>\r\n              <ui-input-group>\r\n                <ui-input-label>Title</ui-input-label>\r\n                <ui-input value.bind=\"alert.title\" clear></ui-input>\r\n              </ui-input-group>\r\n            </ui-column>\r\n            <ui-column fill padded>\r\n              <ui-input-group>\r\n                <ui-input-label>Message</ui-input-label>\r\n                <ui-input value.bind=\"alert.message\"></ui-input>\r\n              </ui-input-group>\r\n            </ui-column>\r\n          </ui-row>\r\n          <ui-row>\r\n            <ui-column fill padded>\r\n              <ui-input-group>\r\n                <ui-input-label>Button Labels</ui-input-label>\r\n                <ui-input value.bind=\"alert.okLabel\" info=\"Ok Label\"></ui-input>\r\n                <ui-input-addon></ui-input-addon>\r\n                <ui-input value.bind=\"alert.cancelLabel\" info=\"Cancel Label\"></ui-input>\r\n              </ui-input-group>\r\n            </ui-column>\r\n            <ui-column fill padded>\r\n              <ui-input-group plain>\r\n                <ui-input-label>Glyph</ui-input-label>\r\n                <ui-dropdown value.bind=\"alert.glyph\" width=\"8em\">\r\n                  <ui-list-item value=\"\">None</ui-list-item>\r\n                  <ui-list-item value=\"glyph-alert-info\" glyph=\"glyph-alert-info\">Info</ui-list-item>\r\n                  <ui-list-item value=\"glyph-alert-exclaim\" glyph=\"glyph-alert-exclaim\">Exclaim</ui-list-item>\r\n                  <ui-list-item value=\"glyph-alert-question\" glyph=\"glyph-alert-question\">Question</ui-list-item>\r\n                  <ui-list-item value=\"glyph-alert-error\" glyph=\"glyph-alert-error\">Error</ui-list-item>\r\n                </ui-dropdown>\r\n              </ui-input-group>\r\n            </ui-column>\r\n          </ui-row>\r\n          <ui-toolbar>\r\n            <ui-button light small click.trigger=\"openAlert()\">Show Alert</ui-button>\r\n            <ui-button light small click.trigger=\"openPrompt()\">Show Prompt</ui-button>\r\n            <ui-button light small click.trigger=\"openConfirm()\">Show Confirm</ui-button>\r\n          </ui-toolbar>\r\n        </ui-fieldset>\r\n\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!components/breadcrumbs.html', ['module'], function(module) { module.exports = "<template>\r\n  <ui-page page-title=\"Breadcrumbs\" animate>\r\n  <style>\r\n    .tab-container {\r\n      height: 320px;\r\n    }\r\n\r\n  </style>\r\n    <ui-content padded scroll>\r\n      <ui-container>\r\n        <h5 class=\"section-title\">With Tabs</h5>\r\n        <div class=\"tab-container\">\r\n          <ui-panel>\r\n            <ui-breadcrumb change.trigger=\"changeTab($event)\">\r\n              <ui-crumb repeat.for=\"c of activeTab+1\" id.bind=\"c\">${crumbs[c]}</ui-crumb>\r\n            </ui-breadcrumb>\r\n            <ui-breadcrumb secondary change.trigger=\"changeTab($event)\">\r\n              <ui-crumb repeat.for=\"c of activeTab+1\" id.bind=\"c\">${crumbs[c]}</ui-crumb>\r\n            </ui-breadcrumb>\r\n            <ui-tab-panel active-tab.bind=\"activeTab\" notabs height=\"10em\" noborder>\r\n              <ui-tab padded scroll>\r\n                <h1>Personal Information...</h1>\r\n              </ui-tab>\r\n              <ui-tab padded scroll>\r\n                <h1>Shipping Information...</h1>\r\n              </ui-tab>\r\n              <ui-tab padded scroll>\r\n                <h1>Payment Information...</h1>\r\n              </ui-tab>\r\n              <ui-tab padded scroll>\r\n                <h1>Agreement...</h1>\r\n                <ui-checkbox checked.bind=\"agree\">Agree to terms</ui-checkbox>\r\n              </ui-tab>\r\n            </ui-tab-panel>\r\n            <ui-toolbar light>\r\n              <ui-button if.bind=\"activeTab!=0\" click.trigger=\"prev()\">Previous</ui-button>\r\n              <ui-button if.bind=\"activeTab+1!=crumbs.length\" click.trigger=\"next()\">Next</ui-button>\r\n              <ui-button secondary if.bind=\"activeTab+1==crumbs.length\" disabled.bind=\"!agree\">Finish</ui-button>\r\n            </ui-toolbar>\r\n          </ui-panel>\r\n        </div>\r\n        <br/><br/>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!components/datagrid.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Datagrid\" animate>\r\n    <style>\r\n      .tab-container {\r\n        position: relative;\r\n        display: flex;\r\n        flex-direction: column;\r\n        align-items: stretch;\r\n        justify-items: stretch;\r\n        border: 1px solid rgba(0,0,0,.1);\r\n      }\r\n      .dg-glyph.icon-moon-appleinc {\r\n        color: DarkSlateGray;\r\n      }\r\n      .dg-glyph.icon-moon-android {\r\n        color: MediumSeaGreen;\r\n      }\r\n      .dg-glyph.icon-moon-amazon {\r\n        color: DarkOrange;\r\n      }\r\n      .dg-glyph.icon-moon-windows8 {\r\n        color: RoyalBlue;\r\n      }\r\n      .dg-glyph.icon-moon-mobile {\r\n        color: Silver;\r\n      }\r\n\r\n    </style>\r\n    <ui-content padded scroll>\r\n      <ui-container>\r\n        <div class=\"tab-container\" style=\"height:500px\">\r\n          <ui-toolbar primary>\r\n          <ui-input-group>\r\n            <ui-input width=\"12em\" value.bind=\"filterValue\" change.delegate=\"filter()\">\r\n              <ui-input-addon glyph=\"icon-fill-search\"></ui-input-addon>\r\n            </ui-input>\r\n          </ui-input-group>\r\n          <ui-filler></ui-filler>\r\n          <ui-button-group>\r\n            <ui-button small primary square glyph=\"icon-moon-undo2\" click.delegate=\"undo()\"></ui-button>\r\n            <!--<ui-button small primary square glyph=\"icon-moon-redo2\" click.delegate=\"filter()\"></ui-button>-->\r\n          </ui-button-group>\r\n          <ui-divider></ui-divider>\r\n          <ui-button primary click.delegate=\"save()\">Save</ui-button>\r\n          <ui-button primary click.delegate=\"edit()\">Edit</ui-button>\r\n           <ui-pager view-model.ref=\"pager\" store.bind=\"store\"></ui-pager>\r\n        </ui-toolbar>\r\n          <ui-datagrid ref=\"datagrid\" store.bind=\"store\" summary-row=\"true\" scroll row-expander rowselect.trigger=\"selected($event.detail.record)\">\r\n            <ui-dg-empty>\r\n              <h5>No records available...</h5>\r\n            </ui-dg-empty>\r\n            <ui-dg-glyph glyph-map.bind=\"icons\" tooltip-map.bind=\"titles\" class=\"dg-glyph\" data-id=\"icon\" sortable locked></ui-dg-glyph>\r\n            <ui-dg-column data-id=\"continent\" editable  sortable resizeable summary=\"Totals\" locked class=\"ui-level-pad ui-titlecase\">Continent</ui-dg-column>\r\n            <ui-dg-link glyph=\"icon-line-search\" label=\"Preview\" width=\"6em\" click.trigger=\"clicked('Link Clicked', $event.detail.record)\" locked>Link</ui-dg-link>\r\n            <ui-dg-column data-id=\"iso2\" editable sortable resizeable  center width=\"7em\">ISO2</ui-dg-column>\r\n            <ui-dg-column data-id=\"iso3\" editable editor.bind=\"textEditor\" combo sortable resizeable  width=\"7em\">Country</ui-dg-column>\r\n            <ui-dg-column data-id=\"currency\" sortable resizeable  center width=\"7em\">Currency</ui-dg-column>\r\n            <ui-dg-column data-id=\"phone\" editable sortable resizeable number  summary=\"count\" end width=\"8em\">Phone prefix</ui-dg-column>\r\n          </ui-datagrid>\r\n        </div>\r\n        </br>\r\n        <!--<div class=\"tab-container\" style=\"height:500px\">\r\n          <ui-datagrid  summary-row=\"true\" data.bind=\"data\"  scroll row-expander rowselect.trigger=\"selected($event.detail.record)\">\r\n            <ui-dg-empty>\r\n              <h5>No records available...</h5>\r\n            </ui-dg-empty>\r\n            <ui-dg-glyph glyph-map.bind=\"icons\" tooltip-map.bind=\"titles\" class=\"dg-glyph\" data-id=\"icon\" sortable locked></ui-dg-glyph>\r\n            <ui-dg-column data-id=\"text\" editable editor.bind=\"textEditor\" combo sortable resizeable summary=\"Totals\" locked class=\"ui-level-pad ui-titlecase\">Text</ui-dg-column>\r\n            <ui-dg-link glyph=\"icon-line-search\" label=\"Preview\" width=\"6em\" click.trigger=\"clicked('Link Clicked', $event.detail.record)\" locked>Link</ui-dg-link>\r\n            <ui-dg-button glyph=\"icon-line-trash-can\" theme=\"danger\" label=\"Delete\" width=\"5em\" click.trigger=\"clicked('Button clicked', $event.detail.record)\" locked>Button</ui-dg-button>\r\n            <ui-dg-column data-id=\"date\" editable sortable resizeable date center width=\"7em\">Date</ui-dg-column>\r\n            <ui-dg-column data-id=\"date\" sortable resizeable age center width=\"7em\">Date</ui-dg-column>\r\n            <ui-dg-column data-id=\"time\" editable sortable resizeable time center width=\"7em\">Time</ui-dg-column>\r\n            <ui-dg-column data-id=\"time\" sortable resizeable fromnow center width=\"7em\">Time</ui-dg-column>\r\n            <ui-dg-column data-id=\"number\" editable sortable resizeable number summary=\"sum\" end width=\"8em\">Number</ui-dg-column>\r\n            <ui-dg-column data-id=\"currency\" editable sortable resizeable currency summary=\"avg\" end width=\"8em\">Currency</ui-dg-column>\r\n          </ui-datagrid>\r\n        </div>\r\n        <br/>-->\r\n        <div class=\"tab-container\" style=\"height:500px\">\r\n          <ui-datagrid  summary-row=\"true\" virtual scroll data.bind=\"data\" row-expander>\r\n            <ui-dg-empty>\r\n              <h5>No records available...</h5>\r\n            </ui-dg-empty>\r\n            <ui-dg-glyph glyph-map.bind=\"icons\" groups=\"\\${['date']}\" tooltip-map.bind=\"titles\" class=\"dg-glyph\" data-id=\"icon\" sortable locked></ui-dg-glyph>\r\n            <ui-dg-column data-id=\"text\" editable sortable resizeable summary=\"Totals\" locked class=\"ui-level-pad ui-titlecase\">Text</ui-dg-column>\r\n            <ui-dg-link glyph=\"icon-line-search\" label=\"Preview\" width=\"6em\" click.trigger=\"clicked('Link Clicked', $event.detail.record)\" locked>Link</ui-dg-link>\r\n            <ui-dg-button glyph=\"icon-line-trash-can\" theme=\"danger\" label=\"Delete\" width=\"5em\" click.trigger=\"clicked('Button clicked', $event.detail.record)\" locked>Button</ui-dg-button>\r\n            <ui-dg-column data-id=\"date\" sortable resizeable date center width=\"7em\">Date</ui-dg-column>\r\n            <ui-dg-column data-id=\"date\" sortable resizeable age center width=\"7em\">Date</ui-dg-column>\r\n            <ui-dg-column data-id=\"time\" sortable resizeable time center width=\"7em\">Time</ui-dg-column>\r\n            <ui-dg-column data-id=\"time\" sortable resizeable fromnow center width=\"7em\">Time</ui-dg-column>\r\n            <ui-dg-column data-id=\"number\" sortable resizeable number summary=\"sum\" end width=\"8em\">Number</ui-dg-column>\r\n            <ui-dg-column data-id=\"currency\" sortable resizeable currency summary=\"avg\" end width=\"8em\">Currency</ui-dg-column>\r\n          </ui-datagrid>\r\n        </div>\r\n        <br/>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
