define('text!components/tree.html', ['module'], function(module) { module.exports = "<template>\r\n  <ui-page page-title=\"Tree\" animate>\r\n  <style>\r\n    .tree-container {\r\n      position: relative;\r\n      height: 450px;\r\n      display: flex;\r\n      flex-direction: row;\r\n      align-items: stretch;\r\n      justify-items: stretch;\r\n      border: 1px solid #e5e5e5;\r\n    }\r\n\r\n  </style>\r\n    <ui-content padded scroll>\r\n      <ui-container>\r\n        <div class=\"tree-container\">\r\n          <ui-section row-layout>\r\n          <ui-sidebar scroll>\r\n            <ui-tree searchable view-model.ref=\"tree\" options.bind=\"treeOpts\" model.bind=\"treeModel\" value.bind=\"treeSelected\"></ui-tree>\r\n          </ui-sidebar>\r\n          <ui-content padded scroll>\r\n            <p repeat.for=\"v of treeSelected | split\">\r\n              <span class=\"ui-flag ${v}\"></span> <span>${countries[v].name || v}</span>\r\n            </p>\r\n            <hr/>\r\n            <div repeat.for=\"p of treeCheck\">\r\n              <p>${p.text} = ${p.children | json}</p>\r\n            </div>\r\n          </ui-content>\r\n          <ui-sidebar scroll position=\"end\" label=\"Options\">\r\n            <ui-button click.trigger=\"getCheckTree()\">Get Checked Tree</ui-button>\r\n            <ui-option-group>\r\n              <ui-checkbox change.trigger=\"clearSelection($event)\" checked=\"true\">Show Checkboxes</ui-checkbox>\r\n            </ui-option-group>\r\n            <ui-input-group if.bind=\"treeOpts.showCheckbox\"class=\"ui-plain\">\r\n              <ui-input-label>Checkbox Level</ui-input-label>\r\n              <ui-dropdown value.bind=\"treeOpts.checkboxLevel\">\r\n                <ui-list-item value=\"0\">0</ui-list-item>\r\n                <ui-list-item value=\"1\">1</ui-list-item>\r\n              </ui-dropdown>\r\n            </ui-input-group>\r\n            <ui-input-group if.bind=\"!treeOpts.showCheckbox\" class=\"ui-plain\">\r\n              <ui-input-label>Selection Level</ui-input-label>\r\n              <ui-dropdown value.bind=\"treeOpts.selectionLevel\">\r\n                <ui-list-item value=\"0\">0</ui-list-item>\r\n                <ui-list-item value=\"1\">1</ui-list-item>\r\n              </ui-dropdown>\r\n            </ui-input-group>\r\n            <ui-input-group class=\"ui-plain\">\r\n              <ui-input-label>Max Leaf Count</ui-input-label>\r\n              <ui-dropdown value.bind=\"treeOpts.maxCount\">\r\n                <ui-list-item value=\"0\">0</ui-list-item>\r\n                <ui-list-item value=\"5\">5</ui-list-item>\r\n              </ui-dropdown>\r\n            </ui-input-group>\r\n          </ui-sidebar>\r\n        </div>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!core/grid.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Responsive Layout\" animate>\r\n  <style>\r\n    .col-view {\r\n      border: 1px solid #e5e5e5;\r\n      background: #A86688;\r\n      min-height: 3rem;\r\n      line-height: 3rem;\r\n      text-align: center;\r\n      color: #fff;\r\n    }\r\n    .col-visi {\r\n      border: 1px dashed #A86688;\r\n      background: #C7B5D1;\r\n      line-height: 3rem;\r\n      text-align: center;\r\n      color: #fff;\r\n    }\r\n\r\n  </style>\r\n    <ui-content padded scroll>\r\n      <ui-container>\r\n        <h4>Responsive Layout</h4>\r\n        <hr/>\r\n        <ui-row>\r\n          <ui-column full padded>\r\n            <h6>X-Large Viewport</h6>\r\n          </ui-column>\r\n          <ui-column size=\"xl-3\" padded>\r\n            <div class=\"col-view\">X-Large 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"xl-3\" padded>\r\n            <div class=\"col-view\">X-Large 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"xl-3\" padded>\r\n            <div class=\"col-view\">X-Large 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"xl-3\" padded>\r\n            <div class=\"col-view\">X-Large 3</div>\r\n          </ui-column>\r\n        </ui-row>\r\n        <ui-row>\r\n          <ui-column full padded>\r\n            <h6>Large Viewport</h6>\r\n          </ui-column>\r\n          <ui-column size=\"lg-3\" padded>\r\n            <div class=\"col-view\">Large 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"lg-3\" padded>\r\n            <div class=\"col-view\">Large 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"lg-3\" padded>\r\n            <div class=\"col-view\">Large 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"lg-3\" padded>\r\n            <div class=\"col-view\">Large 3</div>\r\n          </ui-column>\r\n        </ui-row>\r\n        <ui-row>\r\n          <ui-column full padded>\r\n            <h6>Medium Viewport</h6>\r\n          </ui-column>\r\n          <ui-column size=\"md-3\" padded>\r\n            <div class=\"col-view\">Medium 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"md-3\" padded>\r\n            <div class=\"col-view\">Medium 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"md-3\" padded>\r\n            <div class=\"col-view\">Medium 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"md-3\" padded>\r\n            <div class=\"col-view\">Medium 3</div>\r\n          </ui-column>\r\n        </ui-row>\r\n        <ui-row>\r\n          <ui-column full padded>\r\n            <h6>Small Viewport</h6>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-view\">Small 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-view\">Small 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-view\">Small 3</div>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-view\">Small 3</div>\r\n          </ui-column>\r\n        </ui-row>\r\n        <hr/>\r\n        <ui-row>\r\n          <ui-column full padded>\r\n            <h6>Visibility</h6>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-visi ui-hidden-sm-down\">Hidden >SM</div>\r\n            <div class=\"col-view ui-hidden-sm-up\">Visible &lt;SM</div>\r\n            <p class=\"ui-font-small ui-text-center ui-text-primary\">ui-hidden-sm-up</p>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-visi ui-hidden-md-down\">Hidden >MD</div>\r\n            <div class=\"col-view ui-hidden-md-up\">Visible &lt;MD</div>\r\n            <p class=\"ui-font-small ui-text-center ui-text-primary\">ui-hidden-md-up</p>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-visi ui-hidden-lg-down\">Hidden >LG</div>\r\n            <div class=\"col-view ui-hidden-lg-up\">Visible &lt;LG</div>\r\n            <p class=\"ui-font-small ui-text-center ui-text-primary\">ui-hidden-lg-up</p>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-visi ui-hidden-xl-down\">Hidden >XL</div>\r\n            <div class=\"col-view ui-hidden-xl-up\">Visible &lt;XL</div>\r\n            <p class=\"ui-font-small ui-text-center ui-text-primary\">ui-hidden-xl-up</p>\r\n          </ui-column>\r\n        </ui-row>\r\n        <ui-row>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-visi ui-hidden-sm-up\">Hidden &lt;SM</div>\r\n            <div class=\"col-view ui-hidden-sm-down\">Visible >SM</div>\r\n            <p class=\"ui-font-small ui-text-center ui-text-primary\">ui-hidden-sm-down</p>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-visi ui-hidden-md-up\">Hidden &lt;MD</div>\r\n            <div class=\"col-view ui-hidden-md-down\">Visible >MD</div>\r\n            <p class=\"ui-font-small ui-text-center ui-text-primary\">ui-hidden-md-down</p>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-visi ui-hidden-lg-up\">Hidden &lt;LG</div>\r\n            <div class=\"col-view ui-hidden-lg-down\">Visible >LG</div>\r\n            <p class=\"ui-font-small ui-text-center ui-text-primary\" id=\"test\">ui-hidden-lg-down</p>\r\n          </ui-column>\r\n          <ui-column size=\"sm-3\" padded>\r\n            <div class=\"col-visi ui-hidden-xl-up\">Hidden &lt;XL</div>\r\n            <div class=\"col-view ui-hidden-xl-down\">Visible >XL</div>\r\n            <p class=\"ui-font-small ui-text-center ui-text-primary\">ui-hidden-xl-down</p>\r\n          </ui-column>\r\n        </ui-row>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!core/pages.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Page Components\" animate>\r\n  <style>\r\n    .page-example {\r\n      height: 24em;\r\n      border: 1px solid #f0f0f0;\r\n      border-radius: 4px;\r\n      overflow: hidden;\r\n    }\r\n    .bordered {\r\n      border: 2px dashed #f0f0f0;\r\n    }\r\n\r\n  </style>\r\n    <ui-content padded scroll>\r\n      <ui-container class=\"ui-markdown\">\r\n        <div class=\"page-example ui-row-vertical\">\r\n          <div class=\"page-section ui-bg-secondary ui-text-white ui-pad-h\">Page Title</div>\r\n\r\n          <p class=\"ui-pad-h\">Page Content</p>\r\n\r\n          <div class=\"page-section ui-row-vertical ui-col-fill ui-margin-all bordered\">\r\n            <p class=\"ui-pad-h\">Section</p>\r\n\r\n            <ui-row stretch class=\"ui-col-fill\">\r\n              <ui-column class=\"page-section ui-margin-all bordered\" width=\"18em\">\r\n                <p class=\"ui-pad-h\">Content Holder</p>\r\n              </ui-column>\r\n              <div class=\"page-section ui-col-fill ui-margin-all bordered\">\r\n                <p class=\"ui-pad-h\">Content Holder</p>\r\n              </div>\r\n            </ui-row>\r\n          </div>\r\n        </div>\r\n\r\n        <h5 class=\"section-title\">Loader Overlays</h5>\r\n        <p>Add <code>ui-loader</code> to pages, sections, content, dialogs or panels to show loader overlays during http calls</p>\r\n        <pre mdview=\"html\">\r\n          <xmp><ui-page page-title=\"Page\">\r\n            <ui-loader busy.bind=\"busy\" big|normal|small></ui-loader>\r\n            <ui-content padded scroll>...</ui-content>\r\n          </ui-page></xmp>\r\n        </pre>\r\n\r\n        <h5 class=\"section-title\">Page Markup</h5>\r\n        <p>Layout with single content</p>\r\n        <pre mdview=\"html\">\r\n          <xmp><ui-page page-title=\"Page\">\r\n            <ui-content padded scroll>...</ui-content>\r\n          </ui-page></xmp>\r\n        </pre>\r\n        <p>Layout with sidebar and content</p>\r\n        <pre mdview=\"html\">\r\n          <xmp><ui-page page-title=\"Page\">\r\n            <ui-section row-layout>\r\n              <ui-sidebar scroll>...</ui-sidebar>\r\n              <ui-content padded scroll>...</ui-content>\r\n            </ui-section>\r\n          </ui-page></xmp>\r\n        </pre>\r\n        <p>Layout with toolbar and content</p>\r\n        <pre mdview=\"html\">\r\n          <xmp><ui-page page-title=\"Page\">\r\n            <ui-section column-layout>\r\n              <ui-content padded scroll>...</ui-content>\r\n              <ui-toolbar>...</ui-toolbar>\r\n            </ui-section>\r\n          </ui-page></xmp>\r\n        </pre>\r\n        <p>Layout with multiple sections</p>\r\n        <pre mdview=\"html\">\r\n          <xmp><ui-page page-title=\"Page\">\r\n            <ui-section row-layout>\r\n              <ui-sidebar scroll>...</ui-sidebar>\r\n              <ui-section column-layout>\r\n                <ui-content padded scroll>...</ui-content>\r\n                <ui-toolbar>...</ui-toolbar>\r\n              </ui-section>\r\n            </ui-section>\r\n          </ui-page></xmp>\r\n        </pre>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!core/viewport.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Viewport\" animate>\r\n  <style>\r\n  .viewport-example {\r\n    height: 12em;\r\n    border: 1px solid #f0f0f0;\r\n    border-radius: 4px;\r\n    overflow: hidden;\r\n  }\r\n  .ve-header{\r\n    padding: 1em 1rem;\r\n    height: 3em;\r\n  }\r\n  .ve-footer{\r\n    padding: .1em 1rem;\r\n    height: 1.2em;\r\n    font-size: .8em;\r\n  }\r\n  .ve-taskbar{\r\n    padding: .4em 1rem;\r\n    height: 1.8em;\r\n  }\r\n  .ve-content {\r\n    flex: 1 1 auto;\r\n    padding: 1rem;\r\n  }\r\n  </style>\r\n    <ui-content padded scroll>\r\n      <ui-container class=\"ui-markdown\">\r\n        <p>Main application viewport</p>\r\n        <h5 class=\"section-title\">Internal Parts</h5>\r\n        <div class=\"viewport-example ui-row-vertical\">\r\n          <div class=\"ve-header ui-bg-primary ui-text-white\">Header Slot</div>\r\n          <div class=\"ve-content\">Main Content</div>\r\n          <div class=\"ve-taskbar ui-bg-light\">Hidden taskbar for multiple dialogs, will be visible when a dialog is opened</div>\r\n          <div class=\"ve-footer ui-bg-dark ui-text-white\">Footer Slot</div>\r\n        </div>\r\n\r\n        <h5 class=\"section-title\">Markup</h5>\r\n        <p>Layout with off-screen drawer menu</p>\r\n        <pre mdview=\"html\">\r\n          <xmp><ui-viewport>\r\n            <ui-app-header>\r\n              <ui-drawer-toggle drawer.bind=\"menuDrawer\"></ui-drawer-toggle>\r\n              <ui-app-title src=\"images/logo.png\">\r\n                <h6>App Title</h6>\r\n              </ui-app-title>\r\n              <ui-filler></ui-filler>\r\n              <p if.bind=\"app.Authenticated\">Logged in as username</p>\r\n            </ui-app-header>\r\n\r\n            <ui-drawer ref=\"menuDrawer\" scroll close-on-click>\r\n              App Menu\r\n            </ui-drawer>\r\n\r\n            <ui-router-view></ui-router-view>\r\n\r\n            <ui-app-footer>\r\n              <span>Version x.x</span>\r\n              <span>© 2017</span>\r\n            </ui-app-footer>\r\n          </ui-viewport></xmp>\r\n        </pre>\r\n        <p>Layout with collapsible sidebar menu</p>\r\n        <pre mdview=\"html\">\r\n          <xmp><ui-viewport>\r\n            <ui-app-header>\r\n              <ui-app-title src=\"images/logo.png\">\r\n                <h6>App Title</h6>\r\n              </ui-app-title>\r\n              <ui-filler></ui-filler>\r\n              <p if.bind=\"app.Authenticated\">Logged in as username</p>\r\n            </ui-app-header>\r\n\r\n            <ui-section row-layout>\r\n              <ui-sidebar scroll collapsible>\r\n                App Menu\r\n              </ui-sidebar>\r\n\r\n              <ui-router-view></ui-router-view>\r\n            </ui-section>\r\n\r\n            <ui-app-footer>\r\n              <span>Version x.x</span>\r\n              <span>© 2017</span>\r\n            </ui-app-footer>\r\n          </ui-viewport></xmp>\r\n        </pre>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!examples/dashboard.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Dashboard\" animate>\r\n    <style>\r\n      .ret-table {\r\n        border-spacing: 1px;\r\n        border-collapse: separate;\r\n        font-size: 0.7em;\r\n      }\r\n      .ret-table th {\r\n        text-align: right;\r\n      }\r\n      .ret-table td {\r\n        text-align: center;\r\n        position: relative;\r\n      }\r\n      .ret-table .count {\r\n        padding: 0.75em 0;\r\n        width: 5em;\r\n        border: 1px solid white;\r\n        -webkit-transition: transform 200ms;\r\n        transition: transform 200ms;\r\n        position: relative;\r\n      }\r\n      .ret-table .count:hover {\r\n        -webkit-transition-delay: 500ms;\r\n        transition-delay: 500ms;\r\n        -webkit-transform: scale(1.5);\r\n        transform: scale(1.5);\r\n        z-index: 10;\r\n      }\r\n\r\n    </style>\r\n    <ui-section row-layout>\r\n      <ui-statsbar light-bg vertical>\r\n        <ui-stat class=\"gray\" label=\"Users\" glyph=\"icon-moon-user\">7.11K</ui-stat>\r\n        <ui-stat class=\"teal\" label=\"Downloads\" glyph=\"icon-moon-download3\">11.18K</ui-stat>\r\n        <ui-stat class=\"green\" label=\"Messages\" glyph=\"icon-moon-bubbles3\">9.24K</ui-stat>\r\n        <ui-stat class=\"blue\" label=\"Likes\" glyph=\"icon-moon-heart\">18.24K</ui-stat>\r\n        <ui-stat class=\"indigo\" label=\"Purchases\" glyph=\"icon-moon-star-full\">2.49K</ui-stat>\r\n        <ui-stat class=\"violet\" label=\"Visits\" glyph=\"icon-moon-cloud\">5.04K</ui-stat>\r\n      </ui-statsbar>\r\n      <ui-content scroll>\r\n        <ui-row>\r\n          <ui-column fill padded>\r\n            <ui-panel>\r\n              <ui-loader busy.bind=\"isLoading\"></ui-loader>\r\n              <ui-header class=\"teal\">\r\n                <ui-header-title>Chart Panel</ui-header-title>\r\n                <ui-header-tool refresh click.trigger=\"doRefresh()\"></ui-header-tool>\r\n                <ui-dropdown value=\"2\" change.trigger=\"doRefresh()\">\r\n                  <ui-list-item value=\"0\">Last 30 Days</ui-list-item>\r\n                  <ui-list-item value=\"1\">Last 60 Days</ui-list-item>\r\n                  <ui-list-item value=\"2\">Last 90 Days</ui-list-item>\r\n                </ui-dropdown>\r\n              </ui-header>\r\n              <ui-panel-body padded style=\"text-align: center\">\r\n                <img src=\"images/wireframes/chart-bar.png\" height=\"320px\"/>\r\n              </ui-panel-body>\r\n            </ui-panel>\r\n          </ui-column>\r\n          <ui-column width=\"140px\" padded>\r\n            <ui-panel>\r\n              <ui-header class=\"teal\">Chart Panel</ui-header>\r\n              <ui-panel-body padded>\r\n                <ui-loader small busy.bind=\"isLoading\"></ui-loader>\r\n                <img src=\"images/wireframes/chart-pie.png\" height=\"120px\"/>\r\n              </ui-panel-body>\r\n            </ui-panel>\r\n            <br/>\r\n            <ui-panel>\r\n              <ui-header class=\"teal\">Chart Panel</ui-header>\r\n              <ui-panel-body padded>\r\n                <ui-loader small busy.bind=\"isLoading\"></ui-loader>\r\n                <img src=\"images/wireframes/chart-pie.png\" height=\"120px\"/>\r\n              </ui-panel-body>\r\n            </ui-panel>\r\n          </ui-column>\r\n        </ui-row>\r\n        <ui-row>\r\n          <ui-column fill padded>\r\n            <ui-row spaced>\r\n              <img src=\"images/wireframes/card.png\" height=\"90px\" width=\"45%\" class=\"ui-margin-v\"/>\r\n              <img src=\"images/wireframes/card.png\" height=\"90px\" width=\"45%\" class=\"ui-margin-v\"/>\r\n              <img src=\"images/wireframes/card.png\" height=\"90px\" width=\"45%\" class=\"ui-margin-v\"/>\r\n              <img src=\"images/wireframes/card.png\" height=\"90px\" width=\"45%\" class=\"ui-margin-v\"/>\r\n            </ui-row>\r\n          </ui-column>\r\n          <ui-column fill padded>\r\n            <div class=\"ui-margin-v\">\r\n              <ui-panel>\r\n                <ui-loader busy.bind=\"isReloading\"></ui-loader>\r\n                <ui-header class=\"cyan\">\r\n                  <ui-header-title>App Retention Sample</ui-header-title>\r\n                  <ui-header-tool refresh click.trigger=\"reloadRetentions()\"></ui-header-tool>\r\n                </ui-header>\r\n                <ui-panel-body>\r\n                  <table class=\"ret-table\">\r\n                    <tr>\r\n                      <td></td>\r\n                      <td repeat.for=\"i of 6\">Wk ${i+1}</td>\r\n                    </tr>\r\n                    <tr repeat.for=\"day of retentions | keys\">\r\n                      <th class=\"ui-pad-h\">${day}</th>\r\n                      <td repeat.for=\"i of retentions[day]\">\r\n                        <div class=\"count\" tooltip=\"message.bind: getRetentionTip(i,day,$index+1)\" css.bind=\"{background: getRetentionStyle(i)}\">${(i/100) | number:'0%'}</div>\r\n                      </td>\r\n                    </tr>\r\n                  </table>\r\n                </ui-panel-body>\r\n              </ui-panel>\r\n            </div>\r\n          </ui-column>\r\n        </ui-row>\r\n      </ui-content>\r\n    </ui-section>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!examples/tab.home.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n\r\n<template>\r\n  <ui-page page-title=\"&nbsp;\" animate>\r\n    <ui-section row-layout>\r\n      <ui-statsbar light-bg vertical>\r\n        <ui-stat class=\"gray\" label=\"Members\" glyph=\"icon-moon-users\">7.11K</ui-stat>\r\n        <ui-stat class=\"teal\" label=\"Downloads\" glyph=\"icon-moon-download3\">11.18K</ui-stat>\r\n        <ui-stat class=\"green\" label=\"Messages\" glyph=\"icon-moon-bubbles3\">9.24K</ui-stat>\r\n        <ui-stat class=\"blue\" label=\"Likes\" glyph=\"icon-moon-heart\">18.24K</ui-stat>\r\n        <ui-stat class=\"indigo\" label=\"Purchases\" glyph=\"icon-moon-star-full\">2.49K</ui-stat>\r\n        <ui-stat class=\"violet\" label=\"Visits\" glyph=\"icon-moon-cloud\">5.04K</ui-stat>\r\n      </ui-statsbar>\r\n      <ui-content scroll>\r\n        <ui-row>\r\n          <ui-column fill padded>\r\n            <ui-panel>\r\n              <ui-header class=\"gray\">\r\n                <ui-header-title>Chart Panel</ui-header-title>\r\n                <ui-header-tool refresh></ui-header-tool>\r\n                <ui-dropdown value=\"2\">\r\n                  <ui-list-item value=\"0\">Last 30 Days</ui-list-item>\r\n                  <ui-list-item value=\"1\">Last 60 Days</ui-list-item>\r\n                  <ui-list-item value=\"2\">Last 90 Days</ui-list-item>\r\n                </ui-dropdown>\r\n              </ui-header>\r\n              <ui-panel-body padded style=\"text-align: center\">\r\n                <img src=\"images/wireframes/chart-bar.png\" height=\"320px\"/>\r\n              </ui-panel-body>\r\n            </ui-panel>\r\n          </ui-column>\r\n        </ui-row>\r\n        <ui-row>\r\n          <ui-column fill padded>\r\n            <ui-panel>\r\n              <ui-header class=\"gray\">Chart Panel</ui-header>\r\n              <ui-panel-body padded>\r\n                <ui-row middle>\r\n                  <img src=\"images/wireframes/chart-pie.png\" height=\"120px\"/>\r\n                  <ui-column padded fill>\r\n                    <img src=\"images/wireframes/paragraph.png\" width=\"100%\"/>\r\n                  </ui-column>\r\n                </ui-row>\r\n              </ui-panel-body>\r\n            </ui-panel>\r\n          </ui-column>\r\n          <ui-column fill padded>\r\n            <ui-panel>\r\n              <ui-header class=\"gray\">Chart Panel</ui-header>\r\n              <ui-panel-body padded>\r\n                <ui-row middle>\r\n                  <img src=\"images/wireframes/chart-pie.png\" height=\"120px\"/>\r\n                  <ui-column padded fill>\r\n                    <img src=\"images/wireframes/paragraph.png\" width=\"100%\"/>\r\n                  </ui-column>\r\n                </ui-row>\r\n              </ui-panel-body>\r\n            </ui-panel>\r\n          </ui-column>\r\n        </ui-row>\r\n      </ui-content>\r\n    </ui-section>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!examples/tab.sales.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"&nbsp;\">\r\n    <ui-loader busy.bind=\"isSaving\"></ui-loader>\r\n    <ui-section row-layout>\r\n      <ui-statsbar vertical>\r\n        <ui-stat class=\"gray\" label=\"Total Sales\" glyph=\"icon-moon-book\">${summary.new+summary.renew | number:'0[.]00a'}</ui-stat>\r\n        <ui-stat class=\"teal\" label=\"New Sales\" glyph=\"icon-moon-svg\">${summary.new | number:'0[.]00a'}</ui-stat>\r\n        <ui-stat class=\"green\" label=\"Renewals\" glyph=\"icon-moon-loop\">${summary.renew | number:'0[.]00a'}</ui-stat>\r\n        <ui-stat class=\"blue\" label=\"Total Revenue\" glyph=\"icon-moon-coin-dollar\">${summary.rev | number:'$0[.]00a'}</ui-stat>\r\n      </ui-statsbar>\r\n      <ui-section column-layout>\r\n        <ui-toolbar light>\r\n          <ui-button-group>\r\n            <ui-button small square light click.trigger=\"recToggle(true)\" glyph=\"glyph-icon-expand-all\"></ui-button>\r\n            <ui-button small square light click.trigger=\"recToggle(false)\" glyph=\"glyph-icon-collapse-all\"></ui-button>\r\n          </ui-button-group>\r\n          <ui-filler></ui-filler>\r\n          <ui-button light square glyph=\"glyph-refresh\"></ui-button>\r\n          <ui-button dark square glyph=\"icon-moon-download3\" busy.bind=\"isExporting\" click.trigger=\"doExport()\"></ui-button>\r\n        </ui-toolbar>\r\n        <ui-datagrid row-expander store.bind=\"store\" scroll summary-row=\"summary\">\r\n          <ui-dg-column data-id=\"label\" sortable resizeable class=\"ui-level-pad\" width=\"20em\">&nbsp;</ui-dg-column>\r\n          <ui-dg-column data-id=\"new\" group=\"Sales\" number summary=\"sum\" end width=\"8em\">New Sales</ui-dg-column>\r\n          <ui-dg-column data-id=\"renew\" group=\"Sales\" number summary=\"sum\" end width=\"8em\">Renewals</ui-dg-column>\r\n          <ui-dg-column data-id=\"net\" group=\"Sales\" number summary=\"sum\" end width=\"8em\"\r\n            value.call=\"total(record)\" summary.call=\"totalSum(data)\">Net Sales</ui-dg-column>\r\n          <ui-dg-column data-id=\"rev\" currency summary=\"sum\" end width=\"8em\">Net Revenue</ui-dg-column>\r\n        </ui-datagrid>\r\n      </ui-section>\r\n    </ui-section>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!examples/tab.salesform.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"&nbsp;\">\r\n    <ui-loader busy.bind=\"isSaving\"></ui-loader>\r\n    <ui-content scroll padded>\r\n      <ui-container>\r\n        <ui-form>\r\n          <ui-row center>\r\n            <ui-column width=\"30em\" padded>\r\n              <h6 class=\"ui-bg-light ui-text-pink ui-pad-h\">Membership Details</h6>\r\n              <ui-input-group>\r\n                <ui-input-label required>Account</ui-input-label>\r\n                <ui-dropdown value.bind=\"type\" change.trigger=\"changeType($event.detail)\" width=\"8em\">\r\n                  <ui-list-item value=\"0\">Free</ui-list-item>\r\n                  <ui-list-item value=\"1\">Basic</ui-list-item>\r\n                  <ui-list-item value=\"2\">Premium</ui-list-item>\r\n                  <ui-list-item value=\"3\">Platinum</ui-list-item>\r\n                </ui-dropdown>\r\n                <ui-input-addon class=\"${prefixCls}\">\r\n                  <small class=\"ui-strong\">${prefix}</small>\r\n                </ui-input-addon>\r\n                <ui-input placeholder=\"Account...\" number=\"12345\"></ui-input>\r\n              </ui-input-group>\r\n              <ui-row middle>\r\n                <ui-column fill></ui-column>\r\n                <ui-column width=\"6em\">\r\n                  <div><small>Price</small></div>\r\n                  <div><small>Shipping</small></div>\r\n                  <hr/>\r\n                  <div><small>Discount</small></div>\r\n                  <hr/>\r\n                  <div><small><strong>Total</strong></small></div>\r\n                </ui-column>\r\n                <ui-column width=\"5em\" class=\"ui-text-end\">\r\n                  <div>${amount | currency}</div>\r\n                  <div>${ship | currency}</div>\r\n                  <hr/>\r\n                  <div>${discount | currency}</div>\r\n                  <hr/>\r\n                  <div><strong>${amount+ship+discount | currency}</strong></div>\r\n                </ui-column>\r\n              </ui-row>\r\n              <br/>\r\n              <h6 class=\"ui-bg-light ui-text-pink ui-pad-h\">Personal Details</h6>\r\n              <ui-input-group>\r\n                <ui-input-label required>First Name</ui-input-label>\r\n                <ui-dropdown value=\"Mr\" width=\"5em\">\r\n                  <ui-list-item value=\"Mr\">Mr</ui-list-item>\r\n                  <ui-list-item value=\"Mrs\">Mrs</ui-list-item>\r\n                  <ui-list-item value=\"Miss\">Miss</ui-list-item>\r\n                </ui-dropdown>\r\n                <ui-input placeholder=\"Name...\" value=\"\"></ui-input>\r\n              </ui-input-group>\r\n              <ui-input-group>\r\n                <ui-input-label required>Last Name</ui-input-label>\r\n                <ui-input placeholder=\"Name...\" value=\"\"></ui-input>\r\n              </ui-input-group>\r\n              <br/>\r\n              <h6 class=\"ui-bg-light ui-text-pink ui-pad-h\">Contact Details</h6>\r\n              <ui-input-group>\r\n                <ui-input-label required>Address</ui-input-label>\r\n                <ui-input placeholder=\"Address line 1...\"></ui-input>\r\n              </ui-input-group>\r\n              <ui-input-group>\r\n                <ui-input-label></ui-input-label>\r\n                <ui-input placeholder=\"Optional line 2...\"></ui-input>\r\n              </ui-input-group>\r\n              <ui-input-group>\r\n                <ui-input-label required>City</ui-input-label>\r\n                <ui-input placeholder=\"City...\"></ui-input>\r\n              </ui-input-group>\r\n              <ui-input-group>\r\n                <ui-input-label>Country</ui-input-label>\r\n                <ui-combo value=\"UAE\" options.bind=\"countries\" display-property=\"name\" value-property=\"iso3\" icon-property=\"iso3\" icon-class=\"ui-flag\" select.trigger=\"ctr=$event.detail.iso2||ctr\">\r\n                  <ui-input-addon>\r\n                    <span class=\"ui-flag ${ctr}\"></span>\r\n                  </ui-input-addon>\r\n                </ui-combo>\r\n              </ui-input-group>\r\n              <hr/>\r\n              <ui-input-group>\r\n                <ui-input-label>Email</ui-input-label>\r\n                <ui-input email placeholder=\"user@domain.com\">\r\n                  <ui-input-addon class=\"ui-text-gray ui-bg-light\" glyph=\"icon-moon-envelop\"></ui-input-addon>\r\n                </ui-input>\r\n              </ui-input-group>\r\n              <ui-input-group>\r\n                <ui-input-label required>Phone</ui-input-label>\r\n                <ui-input-addon class=\"ui-text-gray ui-bg-light\" glyph=\"icon-moon-phone\"></ui-input-addon>\r\n                <ui-dropdown value=\"2\" disabled.bind=\"!ctr\" width=\"6.3em\">\r\n                  <ui-list-item value=\"0\">Home</ui-list-item>\r\n                  <ui-list-item value=\"1\">Work</ui-list-item>\r\n                  <ui-list-item value=\"2\">Mobile</ui-list-item>\r\n                </ui-dropdown>\r\n                <ui-phone country.bind=\"ctr\" disabled.bind=\"!ctr\"></ui-phone>\r\n              </ui-input-group>\r\n              <br/>\r\n              <h6 class=\"ui-bg-light ui-text-pink ui-pad-h\">Payment Details</h6>\r\n              <ui-input-group>\r\n                <ui-input-label required>Credit Card</ui-input-label>\r\n                <ui-dropdown value=\"0\" width=\"8em\">\r\n                  <ui-list-item value=\"0\">Visa</ui-list-item>\r\n                  <ui-list-item value=\"1\">Master Card</ui-list-item>\r\n                  <ui-list-item value=\"2\">Amex</ui-list-item>\r\n                  <ui-list-item value=\"3\">Other</ui-list-item>\r\n                </ui-dropdown>\r\n                <ui-input placeholder=\"4141 4141 4141 4141\"></ui-input>\r\n              </ui-input-group>\r\n              <ui-input-group>\r\n                <ui-input-label required>Card Holder</ui-input-label>\r\n                <ui-input placeholder=\"Name...\" value=\"\"></ui-input>\r\n              </ui-input-group>\r\n              <ui-input-group width=\"12em\">\r\n                <ui-input-label required>Expiry</ui-input-label>\r\n                <ui-input-addon class=\"ui-text-gray ui-bg-light\">\r\n                  <small class=\"ui-strong\">MM</small>\r\n                </ui-input-addon>\r\n                <ui-combo options.bind=\"'Jan,Feb,Mar,Apr,May,Jun,Jul,Aug,Sep,Oct,Nov,Dec' | split\"></ui-combo>\r\n                <ui-input-addon class=\"ui-text-gray ui-bg-light\">\r\n                  <small class=\"ui-strong\">YY</small>\r\n                </ui-input-addon>\r\n                <ui-combo options.bind=\"'2017,2018,2019,2020,2021,2022' | split\"></ui-combo>\r\n              </ui-input-group>\r\n              <ui-input-group width=\"4em\">\r\n                <ui-input-label required>CCV</ui-input-label>\r\n                <ui-input placeholder=\"123\" number=\"\"></ui-input>\r\n              </ui-input-group>\r\n            </ui-column>\r\n          </ui-row>\r\n        </ui-form>\r\n      </ui-container>\r\n    </ui-content>\r\n    <ui-toolbar>\r\n      <ui-button primary click.trigger=\"doSave()\">Save</ui-button>\r\n    </ui-toolbar>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!examples/tab.search.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n\r\n<template>\r\n  <ui-page page-title=\"&nbsp;\">\r\n    <ui-section row-layout>\r\n      <ui-sidebar scroll>\r\n        <ui-affix-content>\r\n          <div class=\"ui-text-end ui-pad-h\">\r\n            <ui-button light small>Reset</ui-button>\r\n            <span>&nbsp;</span>\r\n            <ui-button secondary small>Search</ui-button>\r\n          </div>\r\n        </ui-affix-content>\r\n        <ui-row>\r\n          <ui-column auto class=\"ui-pad-h\">\r\n            <ui-button-group>\r\n              <ui-button small square light click.trigger=\"treeToggle(true)\" glyph=\"glyph-icon-expand-all\"></ui-button>\r\n              <ui-button small square light click.trigger=\"treeToggle(false)\" glyph=\"glyph-icon-collapse-all\"></ui-button>\r\n            </ui-button-group>\r\n          </ui-column>\r\n          <ui-column fill class=\"ui-text-end ui-pad-h\">\r\n            <ui-button light small>Reset</ui-button>\r\n            <span>&nbsp;</span>\r\n            <ui-button secondary small>Search</ui-button>\r\n          </ui-column>\r\n        </ui-row>\r\n        <ui-affix-point></ui-affix-point>\r\n        <hr/>\r\n        <ui-tree options.bind=\"treeOptions\" model.bind=\"treeModel\" view-model.ref=\"searchTree\"></ui-tree>\r\n      </ui-sidebar>\r\n      <ui-section column-layout>\r\n        <ui-row middle>\r\n          <ui-column width=\"15em\">\r\n            <ui-input-group>\r\n              <ui-input-label align-top>Filter by Account</ui-input-label>\r\n              <ui-input maxlength=\"15\" clear></ui-input>\r\n            </ui-input-group>\r\n          </ui-column>\r\n          <ui-column width=\"15em\">\r\n            <ui-input-group>\r\n              <ui-input-label align-top>Filter by Name</ui-input-label>\r\n              <ui-input clear></ui-input>\r\n            </ui-input-group>\r\n          </ui-column>\r\n          <ui-filler></ui-filler>\r\n          <ui-column auto padded>\r\n            <ui-button light square glyph=\"icon-moon-floppy-disk\" form.bind=\"btnSearchSave\" busy.bind=\"isSaving\"></ui-button>\r\n            &nbsp;\r\n            <ui-button dark square glyph=\"icon-moon-download3\" busy.bind=\"isExporting\" click.trigger=\"doExport()\"></ui-button>\r\n          </ui-column>\r\n        </ui-row>\r\n\r\n        <ui-row middle>\r\n          <template repeat.for=\"section of chips\">\r\n            <ui-chip small removable repeat.for=\"chip of section.values\" label.bind=\"section.label\">${chip}</ui-chip>\r\n          </template>\r\n        </ui-row>\r\n\r\n        <ui-form ref=\"btnSearchSave\" busy.bind=\"isSaving\" submit.trigger=\"saveQuery()\" class=\"ui-pad-all\">\r\n          <ui-loader busy.bind=\"isSaving\"></ui-loader>\r\n          <ui-input-group>\r\n            <ui-input-label>Name</ui-input-label>\r\n            <ui-input maxlength=\"24\" width=\"12em\" counter></ui-input>\r\n          </ui-input-group>\r\n          <ui-input-group>\r\n            <ui-input-label>Description</ui-input-label>\r\n            <ui-input maxlength=\"99\" width=\"18em\" counter></ui-input>\r\n          </ui-input-group>\r\n          <div class=\"ui-text-end\">\r\n            <ui-button dark small click.trigger=\"saveQuery()\">Save</ui-button>\r\n          </div>\r\n        </ui-form>\r\n\r\n        <ui-datagrid scroll>\r\n          <ui-dg-empty>\r\n            <h4 class=\"ui-display-4 ui-text-muted ui-text-center\">No Members Found</h4>\r\n          </ui-dg-empty>\r\n          <ui-dg-column locked sortable width=\"50px\">ID</ui-dg-column>\r\n          <ui-dg-column locked sortable width=\"100px\">Account</ui-dg-column>\r\n          <ui-dg-column sortable>Name</ui-dg-column>\r\n          <ui-dg-column sortable width=\"100px\">Since</ui-dg-column>\r\n          <ui-dg-column sortable width=\"100px\">Expiry</ui-dg-column>\r\n        </ui-datagrid>\r\n      </ui-section>\r\n    </ui-section>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!examples/tabbed.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n\r\n<template>\r\n  <ui-tab-panel active-tab.bind=\"tabActive\" view-model.ref=\"tabPanel\" class=\"ex-tabs\">\r\n    <style>\r\n    .ex-tabs .ui-tabbar .ui-tab-button.ui-active {\r\n      background: #8F1C56;\r\n      color: #fff;\r\n    }\r\n    .ex-tabs .ui-page-title {\r\n      line-height: .5em;\r\n    }\r\n    </style>\r\n    <ui-tabbar-start>\r\n      <small>&nbsp;&nbsp;</small>\r\n      <ui-dropdown>\r\n        <ui-list-item value=\"asia\">Asia</ui-list-item>\r\n        <ui-list-item value=\"europe\">Europe</ui-list-item>\r\n        <ui-list-item value=\"america\">Americas</ui-list-item>\r\n      </ui-dropdown>\r\n      <ui-tabbar-toggle dropdown.bind=\"btnHomeMenu\">\r\n        <ui-glyph glyph=\"glyph-icon-plus\"></ui-glyph>\r\n      </ui-tabbar-toggle>\r\n    </ui-tabbar-start>\r\n    <ui-menu ref=\"btnHomeMenu\">\r\n      <ui-row>\r\n        <ui-column>\r\n          <ui-menu-item click.trigger=\"openTab('search')\" glyph=\"icon-moon-search\">Search</ui-menu-item>\r\n          <ui-menu-item glyph=\"icon-moon-folder-open\" disabled=\"true\">Open Search...</ui-menu-item>\r\n          <ui-divider></ui-divider>\r\n          <ui-menu-item click.trigger=\"openTab('members')\" glyph=\"icon-moon-users\" disabled=\"true\">Members</ui-menu-item>\r\n          <ui-menu-item click.trigger=\"openTab('salesform')\" glyph=\"icon-moon-insert-template\">Sales Form</ui-menu-item>\r\n        </ui-column>\r\n        <ui-column>\r\n          <ui-menu-item click.trigger=\"openTab('sales')\" glyph=\"icon-moon-stats-bars\">Sales History</ui-menu-item>\r\n          <ui-menu-item glyph=\"icon-moon-stats-bars\" disabled=\"true\">Order History</ui-menu-item>\r\n          <ui-divider></ui-divider>\r\n          <ui-menu-item glyph=\"icon-moon-mobile\" disabled=\"true\">Email Campaigns</ui-menu-item>\r\n          <ui-menu-item glyph=\"blank\" disabled=\"true\">SMS Campaigns</ui-menu-item>\r\n        </ui-column>\r\n      </ui-row>\r\n    </ui-menu>\r\n    <ui-tab id=\"home\" glyph=\"icon-moon-home\" flex>\r\n      <compose view=\"./tab.home.html\"></compose>\r\n    </ui-tab>\r\n    <ui-tab repeat.for=\"tab of tabs\" id.bind=\"tab.id\" label.bind=\"tab.label\" glyph.bind=\"tab.glyph\" flex closeable beforeclose.call=\"beforeClose(tab.id, $event)\">\r\n      <compose view-model.bind=\"tab.viewModel\" close.trigger=\"closeTab(tab.id)\"></compose>\r\n    </ui-tab>\r\n  </ui-tab-panel>\r\n</template>\r\n"; });
define('text!examples/view.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-section row-layout animate>\r\n  <style>\r\n    .bordered {\r\n      border: 1px solid #e5e5e5;\r\n    }\r\n\r\n  </style>\r\n    <ui-sidebar label=\"Examples\" collapsible scroll class=\"ui-hidden-lg-down\">\r\n      <ui-menu>\r\n        <ui-menu-item repeat.for=\"route of router.navigation\" href.bind=\"route.href\" active.bind=\"route.isActive\" icon.bind=\"route.settings.icon\" disabled.bind=\"route.settings.disabled\">${route.settings.title || route.title}</ui-menu-item>\r\n      </ui-menu>\r\n    </ui-sidebar>\r\n    <ui-section style=\"padding: 2em 3em;\">\r\n\r\n      <ui-row-column class=\"bordered ui-col-fill\">\r\n        <div class=\"ui-app-header\"><img align=\"left\" src=\"images/feature-theme.svg\" width=\"16\"/>&nbsp;App Examples</div>\r\n        <ui-router-view></ui-router-view>\r\n        <div class=\"ui-app-footer\"><small>Copyright ©</small></div>\r\n      </ui-row-column>\r\n    </ui-section>\r\n  </ui-section>\r\n</template>\r\n"; });
define('text!home/browser.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <style>\r\n    .browser-list {}\r\n    .browser-list td {\r\n      width: 32px;\r\n      line-height: 1;\r\n      font-size: 1rem;\r\n      font-weight: 300;\r\n      padding: 0.4em 0.8em;\r\n      border: 1px solid #f0f0f0;\r\n    }\r\n    .browser-list td:first-child {\r\n      width: 180px;\r\n    }\r\n\r\n    .browser-list td.op1 {\r\n      background: url('images/browsers/success.png') no-repeat center center;\r\n    }\r\n    .browser-list td.op2 {\r\n      background: url('images/browsers/error.png') no-repeat center center;\r\n    }\r\n    .browser-list td.op0 {\r\n      background: url('images/browsers/warning.png') no-repeat center center;\r\n    }\r\n    .browser-list tbody tr:nth-child(odd) {\r\n      background: #fcfcfc;\r\n    }\r\n\r\n  </style>\r\n  <h5 class=\"section-title\" t=\"home:support.title\"></h5>\r\n  <table class=\"browser-list\">\r\n    <tr>\r\n      <td colspan=\"7\" style=\"border:none;text-align:right;\">\r\n        <span class=\"ui-font-small\"><img src=\"images/browsers/success.png\" height=\"12px\"/>\r\n          ${'home:support.tested' & t}&nbsp;&nbsp;</span>\r\n        <span class=\"ui-font-small\"><img src=\"images/browsers/warning.png\" height=\"12px\"/>\r\n          ${'home:support.untested' & t}&nbsp;&nbsp;</span>\r\n        <span class=\"ui-font-small\"><img src=\"images/browsers/error.png\" height=\"12px\"/>\r\n          ${'home:support.issues' & t}</span>\r\n      </td>\r\n    </tr>\r\n    <tr>\r\n      <td width=\"180px\">&nbsp;</td>\r\n      <td><img src=\"images/browsers/safari.png\" width=\"32\" tooltip=\"message.bind: 'Safari'\"/></td>\r\n      <td><img src=\"images/browsers/chrome.png\" width=\"32\" tooltip=\"message.bind: 'Google Chrome'\"/></td>\r\n      <td><img src=\"images/browsers/firefox.png\" width=\"32\" tooltip=\"message.bind: 'Firefox'\"/></td>\r\n      <td><img src=\"images/browsers/opera.png\" width=\"32\" tooltip=\"message.bind: 'Opera'\"/></td>\r\n      <td><img src=\"images/browsers/edge.png\" width=\"32\" tooltip=\"message.bind: 'MS Edge'\"/></td>\r\n    </tr>\r\n    <tbody>\r\n      <tr>\r\n        <td colspan=\"7\">\r\n          <span class=\"ui-strong ui-text-primary\" t=\"home:support.sectionCore\"></span>\r\n        </td>\r\n      </tr>\r\n      <tr repeat.for=\"el of core\">\r\n        <td t.bind=\"el.label\"></td>\r\n        <td class=\"op${el.s}\"></td>\r\n        <td class=\"op${el.c}\"></td>\r\n        <td class=\"op${el.f}\"></td>\r\n        <td class=\"op${el.o}\"></td>\r\n        <td class=\"op${el.e}\"></td>\r\n      </tr>\r\n    </tbody>\r\n    <tbody>\r\n      <tr>\r\n        <td colspan=\"7\">\r\n          <span class=\"ui-strong ui-text-primary\" t=\"home:support.sectionInputs\"></span>\r\n        </td>\r\n      </tr>\r\n      <tr repeat.for=\"el of inputs\">\r\n        <td t.bind=\"el.label\"></td>\r\n        <td class=\"op${el.s}\"></td>\r\n        <td class=\"op${el.c}\"></td>\r\n        <td class=\"op${el.f}\"></td>\r\n        <td class=\"op${el.o}\"></td>\r\n        <td class=\"op${el.e}\"></td>\r\n      </tr>\r\n    </tbody>\r\n    <tbody>\r\n      <tr>\r\n        <td colspan=\"7\">\r\n          <span class=\"ui-strong ui-text-primary\" t=\"home:support.sectionComponents\"></span>\r\n        </td>\r\n      </tr>\r\n      <tr repeat.for=\"el of comps\">\r\n        <td t.bind=\"el.label\"></td>\r\n        <td class=\"op${el.s}\"></td>\r\n        <td class=\"op${el.c}\"></td>\r\n        <td class=\"op${el.f}\"></td>\r\n        <td class=\"op${el.o}\"></td>\r\n        <td class=\"op${el.e}\"></td>\r\n      </tr>\r\n    </tbody>\r\n    <tbody>\r\n      <tr>\r\n        <td colspan=\"7\">\r\n          <span class=\"ui-strong ui-text-primary\" t=\"home:support.sectionApi\"></span>\r\n        </td>\r\n      </tr>\r\n      <tr repeat.for=\"el of features\">\r\n        <td t.bind=\"el.label\"></td>\r\n        <td class=\"op${el.s}\"></td>\r\n        <td class=\"op${el.c}\"></td>\r\n        <td class=\"op${el.f}\"></td>\r\n        <td class=\"op${el.o}\"></td>\r\n        <td class=\"op${el.e}\"></td>\r\n      </tr>\r\n    </tbody>\r\n  </table>\r\n</template>\r\n"; });
