define('text!start/prereq.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Pre-Requisites\" animate>\r\n    <ui-content scroll padded>\r\n      <ui-container class=\"ui-markdown\">\r\n        <h6 class=\"section-title\">Requirements</h6>\r\n        <p>\r\n          <ul>\r\n            <li>\r\n              Install NodeJS version 4.x or above.\r\n              <ul>\r\n                <li>You can\r\n                  <a href=\"https://nodejs.org/en/\" target=\"_blank\">download it here</a>.</li>\r\n              </ul>\r\n            </li>\r\n          </ul>\r\n        </p>\r\n        <h6 class=\"section-title\">Setup Aurelia Project</h6>\r\n        <p>\r\n          <ul>\r\n            <li>Install the gulp and aurelia CLI using npm.\r\n              <pre mdview=\"shell\">npm install gulp-cli aurelia-cli typings -g</pre>\r\n              <div class=\"note\">You may need to use\r\n                <code>sudo</code>\r\n                to global install aurelia-cli, gulp-cli and typings</div>\r\n            </li>\r\n            <li>Create a new aurelia project\r\n              <code>au new --here</code>\r\n              <p>Install the framework dependencies</p>\r\n              <pre mdview=\"shell\">\r\n                npm i aurelia-ui-framework -S\r\n                npm i gulp-compass gulp-plumber del -SD\r\n\r\n                npm i lodash\r\n\r\n                typings i dt~moment dt~numeraljs -S -G\r\n                typing i lodash -S\r\n              </pre>\r\n              <div class=\"note\">\r\n                You can start with the default blank project or update it with the AUF starter project.\r\n                <br/>\r\n                You can\r\n                <a href=\"https://www.dropbox.com/sh/1b2ytrrk0n8wpva/AAB7qLUK5huA9ssd5wpwDtSha?dl=0\" target=\"_blank\">download it here</a>.\r\n              </div>\r\n            </li>\r\n            <li>Update the aurelia project config with the following\r\n              <div>\r\n                <code>transpiler.dtsSource</code>\r\n              </div>\r\n              <pre mdview=\"json\">\r\n                  [\r\n                    \"./typings/**/*.d.ts\",\r\n                    \"./custom_typings/**/*.d.ts\",\r\n                    \"./node_modules/aurelia-ui-framework/dist/typings/**/*.d.ts\"\r\n                  ]\r\n              </pre>\r\n              <div>\r\n                <code>bundles</code>\r\n              </div>\r\n              <pre mdview=\"json\">\r\n                {\r\n                  \"name\": \"framework-bundle.js\",\r\n                  \"prepend\": [\r\n                    \"node_modules/whatwg-fetch/fetch.js\"\r\n                  ],\r\n                  \"dependencies\": [\r\n                    \"lodash\",\r\n                    \"moment\",\r\n                    \"numeral\",\r\n                    \"aurelia-fetch-client\",\r\n                    {\r\n                      \"name\": \"kramed\",\r\n                      \"path\": \"../node_modules/kramed/lib\",\r\n                      \"main\": \"kramed\"\r\n                    },\r\n                    {\r\n                      \"name\": \"aurelia-validation\",\r\n                      \"path\": \"../node_modules/aurelia-validation/dist/amd\",\r\n                      \"main\": \"aurelia-validation\"\r\n                    },\r\n                    {\r\n                      \"name\": \"aurelia-ui-virtualization\",\r\n                      \"path\": \"../node_modules/aurelia-ui-virtualization/dist/amd\",\r\n                      \"main\": \"aurelia-ui-virtualization\"\r\n                    },\r\n                    {\r\n                      \"name\": \"aurelia-ui-framework\",\r\n                      \"path\": \"../node_modules/aurelia-ui-framework/dist/amd\",\r\n                      \"main\": \"aurelia-ui-framework\"\r\n                    }\r\n                  ]\r\n                }\r\n            </pre>\r\n            </li>\r\n          </ul>\r\n        </p>\r\n\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!start/start.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Using the Framework\" animate>\r\n    <ui-content scroll padded>\r\n      <ui-container class=\"ui-markdown\">\r\n\r\n        <h6 class=\"section-title\">Installing Aurelia UI Framework</h6>\r\n\r\n        <pre mdview=\"shell\">npm install aurelia-ui-framework --save</pre>\r\n\r\n        <h6 class=\"section-title\">Including it in your Application</h6>\r\n\r\n        <p>To use aurelia-ui-framework in your application, add the plugin in\r\n          <em>main.ts</em>.\r\n          <pre mdview=\"ts\">\r\n            import {Aurelia} from 'aurelia-framework';\r\n            import {UIConfig} from 'aurelia-ui-framework';\r\n\r\n            export function configure(aurelia: Aurelia) {\r\n              aurelia.use\r\n                .plugin('aurelia-validation', (config:UIConfig) => {\r\n\r\n                })\r\n                .plugin('aurelia-ui-virtualization')\r\n                .plugin('aurelia-ui-framework');\r\n              }\r\n          </pre>\r\n          <div class=\"note\">aurelia-validation needs to be loaded as well in order to use the validation renderer</div>\r\n        </p>\r\n\r\n        <h6 class=\"section-title\">Create the Application Viewport</h6>\r\n        <p>The framework requires the main view\r\n          <em>app.html</em>\r\n          to contain the viewport\r\n          <pre mdview=\"html\">\r\n            <xmp><ui-viewport>\r\n              <ui-app-header>\r\n                <ui-drawer-toggle drawer.bind=\"menuDrawer\"></ui-drawer-toggle>\r\n                <ui-app-title src=\"images/logo.png\">\r\n                  <h6>App Title</h6>\r\n                </ui-app-title>\r\n              </ui-app-header>\r\n\r\n              <ui-drawer ref=\"menuDrawer\" scroll close-on-click>\r\n                App Menu\r\n              </ui-drawer>\r\n\r\n              <ui-router-view></ui-router-view>\r\n\r\n              <ui-app-footer>\r\n                <span>Version x.x</span>\r\n                <span>© 2017</span>\r\n              </ui-app-footer>\r\n            </ui-viewport></xmp>\r\n          </pre>\r\n\r\n        </ui-container>\r\n      </ui-content>\r\n    </ui-page>\r\n  </template>\r\n"; });
define('text!start/view.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-section row-layout animate>\r\n    <ui-sidebar label=\"Getting Started\" collapsible scroll>\r\n      <ui-menu>\r\n        <ui-menu-item repeat.for=\"route of router.navigation\" href.bind=\"route.href\" active.bind=\"route.isActive\" icon.bind=\"route.settings.icon\" disabled.bind=\"route.settings.disabled\">${route.settings.title || route.title}</ui-menu-item>\r\n      </ui-menu>\r\n    </ui-sidebar>\r\n    <ui-router-view></ui-router-view>\r\n  </ui-section>\r\n</template>\r\n"; });
define('text!styles/flags.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Flag Icons\" animate>\r\n  <style>\r\n    .flag-card {\r\n      display: inline-block;\r\n      border-radius: 0.5em;\r\n      margin: 0.5em;\r\n      width: 128px;\r\n      text-align: center;\r\n    }\r\n    .flag-card .ui-flag {\r\n      margin: 0.5rem auto;\r\n      width: 32px;\r\n      height: 21px;\r\n    }\r\n    .flag-card .name {\r\n      font-size: 0.8rem;\r\n      overflow: hidden;\r\n      line-height: 1.5;\r\n      white-space: nowrap;\r\n      text-overflow: ellipsis;\r\n    }\r\n    .flag-card .code {\r\n      font-size: 0.6rem;\r\n    }\r\n\r\n  </style>\r\n    <ui-content padded scroll>\r\n      <ui-container dir=\"ltr\">\r\n        <h5>Flag Icons\r\n          <small>\r\n            Downloaded from\r\n            <a class=\"ui-link\" target=\"_blank\" href=\"http://www.flaticon.com/packs/international-flags\">Flaticon</a>\r\n          </small>\r\n        </h5>\r\n        <ui-row>\r\n          <div repeat.for=\"key of countries | keys\">\r\n            <h5 class=\"section-title\">${key}</h5>\r\n            <div class=\"flag-card ui-border-all ui-border-light\" repeat.for=\"c of countries[key]\">\r\n              <ui-glyph class=\"ui-flag ${c.iso2}\"></ui-glyph>\r\n              <div class=\"name\">${c.name}</div>\r\n              <div class=\"code ui-text-info ui-selectable\">${c.iso2}&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;${c.iso3}</div>\r\n            </div>\r\n          </div>\r\n        </ui-row>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!styles/glyphs.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Glyphs\" animate>\r\n  <style>\r\n    .glyph-card {\r\n      display: inline-block;\r\n      border-radius: 0.5em;\r\n      margin: 0.5em;\r\n      width: 128px;\r\n      height: 128px;\r\n      text-align: center;\r\n    }\r\n    .glyph-card .ui-icon {\r\n      margin: 1rem auto;\r\n      font-size: 2rem;\r\n      color: #623462;\r\n    }\r\n    .glyph-card .name {\r\n      font-size: 0.8rem;\r\n      line-height: 1.5;\r\n    }\r\n\r\n    .sticky-top {\r\n      position: -webkit-sticky;\r\n      position: sticky;\r\n      top: 0;\r\n      z-index: 10;\r\n      background: #fff;\r\n    }\r\n\r\n  </style>\r\n    <ui-content padded scroll>\r\n      <ui-container dir=\"ltr\">\r\n        <ui-row bottom class=\"sticky-top\">\r\n          <h5 class=\"ui-col-fill\">Icon Glyphs</h5>\r\n          <ui-column width=\"220px\" class=\"ui-sticky\">\r\n            <ui-input value.bind=\"filterText\" input.trigger=\"filter() & debounce\" clear placeholder=\"Search...\">\r\n              <ui-input-addon class=\"ui-text-muted\" glyph=\"glyph-search\"></ui-input-addon>\r\n            </ui-input>\r\n          </ui-column>\r\n        </ui-row>\r\n        <div repeat.for=\"key of glyphs | keys\" show.bind=\"!filterText\">\r\n          <h5 class=\"section-title\">${key}</h5>\r\n          <ui-row>\r\n            <div class=\"glyph-card ui-border-all ui-border-light\" repeat.for=\"c of glyphs[key]\">\r\n              <ui-glyph glyph.bind=\"c\" class=\"ui-anim-color\"></ui-glyph>\r\n              <div class=\"name ui-selectable\">${c}</div>\r\n            </div>\r\n          </ui-row>\r\n        </div>\r\n        <h5 class=\"section-title\">\r\n          <a href=\"https://icomoon.io\" target=\"_blank\">Icomoon Icons</a>\r\n        </h5>\r\n        <ui-row>\r\n          <div class=\"glyph-card ui-border-all ui-border-light\" repeat.for=\"c of fIcomoon | sort\">\r\n            <ui-glyph glyph.bind=\"c\"></ui-glyph>\r\n            <div class=\"name ui-selectable\">${c}</div>\r\n          </div>\r\n        </ui-row>\r\n        <h5 class=\"section-title\">\r\n          <a href=\"http://hawcons.com\" target=\"_blank\">Hawcons Linear Icons</a>\r\n        </h5>\r\n        <ui-row>\r\n          <div class=\"glyph-card ui-border-all ui-border-light\" repeat.for=\"c of fHawLine | sort\">\r\n            <ui-glyph glyph.bind=\"c\"></ui-glyph>\r\n            <div class=\"name ui-selectable\">${c}</div>\r\n          </div>\r\n        </ui-row>\r\n        <h5 class=\"section-title\">\r\n          <a href=\"http://hawcons.com\" target=\"_blank\">Hawcons Filled Icons</a>\r\n        </h5>\r\n        <ui-row>\r\n          <div class=\"glyph-card ui-border-all ui-border-light\" repeat.for=\"c of fHawFill | sort\">\r\n            <ui-glyph glyph.bind=\"c\"></ui-glyph>\r\n            <div class=\"name ui-selectable\">${c}</div>\r\n          </div>\r\n        </ui-row>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
define('text!styles/home.html', ['module'], function(module) { module.exports = "<!--\r\n// @author      : Adarsh Pastakia\r\n// @copyright   : 2017\r\n// @license     : MIT\r\n-->\r\n<template>\r\n  <ui-page page-title=\"Theming Overview\" animate>\r\n  <style>\r\n    .color-card {\r\n      min-width: 5rem;\r\n      font-size: 0.8rem;\r\n      text-align: center;\r\n      padding: 0.5rem 1rem;\r\n      margin: 0.25rem;\r\n      line-height: 1.5;\r\n      display: inline-block;\r\n      border-radius: 0.5em;\r\n    }\r\n\r\n    .grid-container {\r\n      position: relative;\r\n      height: 320px;\r\n    }\r\n    .grid-container div {\r\n      position: absolute;\r\n      top: 0;\r\n      left: 0;\r\n      border-width: 0.1em;\r\n      padding: 0.5em 1em;\r\n      text-align: right;\r\n      text-align: end;\r\n      display: flex;\r\n      align-items: flex-end;\r\n      justify-content: space-between;\r\n    }\r\n    .grid-container .xs {\r\n      width: 20%;\r\n      height: 64px;\r\n    }\r\n    .grid-container .sm {\r\n      width: 30%;\r\n      height: 128px;\r\n    }\r\n    .grid-container .md {\r\n      width: 50%;\r\n      height: 192px;\r\n    }\r\n    .grid-container .lg {\r\n      width: 75%;\r\n      height: 256px;\r\n    }\r\n    .grid-container .xl {\r\n      width: 100%;\r\n      height: 320px;\r\n    }\r\n\r\n  </style>\r\n    <ui-content padded scroll>\r\n      <ui-container>\r\n        <h5 class=\"section-title\">Theme Colors</h5>\r\n        <div>\r\n          <div class=\"color-card ui-text-light ui-bg-primary\">Primary</div>\r\n          <div class=\"color-card ui-text-light ui-bg-secondary\">Secondary</div>\r\n          <div class=\"color-card ui-text-dark ui-bg-light\">Light</div>\r\n          <div class=\"color-card ui-text-light ui-bg-muted\">Muted</div>\r\n          <div class=\"color-card ui-text-light ui-bg-dark\">Dark</div>\r\n          <div class=\"color-card ui-text-light ui-bg-info\">Info</div>\r\n          <div class=\"color-card ui-text-light ui-bg-danger\">Danger</div>\r\n          <div class=\"color-card ui-text-light ui-bg-success\">Success</div>\r\n          <div class=\"color-card ui-text-light ui-bg-warning\">Warning</div>\r\n        </div>\r\n\r\n        <h6 class=\"section-title\">Extra Colors</h6>\r\n        <div>\r\n          <div class=\"color-card ui-titlecase ui-text-light ui-bg-${color}\" repeat.for=\"color of colors | split\">${color}</div>\r\n        </div>\r\n\r\n        <hr/>\r\n        <h5 class=\"section-title\">Fonts</h5>\r\n\r\n        <h6 class=\"ui-pad-all ui-text-muted\">Default</h6>\r\n        <h4 class=\"ui-pad-all ui-font-default ui-thin\" innerhtml.bind=\"chars\"></h4>\r\n        <br>\r\n        <h6 class=\"ui-pad-all ui-text-muted\">Serif</h6>\r\n        <h4 class=\"ui-pad-all ui-font-serif ui-thin\" innerhtml.bind=\"chars\"></h4>\r\n        <br>\r\n        <h6 class=\"ui-pad-all ui-text-muted\">Input</h6>\r\n        <h4 class=\"ui-pad-all ui-font-input ui-thin\" innerhtml.bind=\"chars\"></h4>\r\n        <br>\r\n        <h6 class=\"ui-pad-all ui-text-muted\">Fixed Width</h6>\r\n        <h4 class=\"ui-pad-all ui-font-fixed ui-thin\" innerhtml.bind=\"chars\"></h4>\r\n\r\n        <hr/>\r\n        <h5 class=\"section-title\">Responsive Sizing</h5>\r\n        <p class=\"ui-pad-v\">Responsive layout breakpoints</p>\r\n        <div class=\"grid-container\">\r\n          <div class=\"xl ui-hidden-xl-down ui-border-all ui-border-primary\">\r\n            <span class=\"ui-text-primary\">Large Monitor</span>\r\n            <h6>X-Large<small>1536px &hArr; &infin;</small>\r\n            </h6>\r\n          </div>\r\n          <div class=\"lg ui-hidden-lg-down ui-border-all ui-border-secondary\">\r\n            <span class=\"ui-text-secondary\">Small Monitor</span>\r\n            <h6>Large<small>1024px &hArr; 1536px</small>\r\n            </h6>\r\n          </div>\r\n          <div class=\"md ui-hidden-md-down ui-border-all ui-border-info\">\r\n            <span class=\"ui-text-info\">Tablet</span>\r\n            <h6>Medium<small>768px &hArr; 1024px</small>\r\n            </h6>\r\n          </div>\r\n          <div class=\"sm ui-hidden-sm-down ui-border-all ui-border-danger\">\r\n            <span class=\"ui-text-danger\">Mobile</span>\r\n            <h6>Small<small>480px &hArr; 768px</small>\r\n            </h6>\r\n          </div>\r\n          <div class=\"xs ui-hidden-xs-down ui-border-all ui-border-warning\">\r\n            <span class=\"ui-text-danger\"></span>\r\n            <h6>X-Small<small>320px &hArr; 480px</small>\r\n            </h6>\r\n          </div>\r\n        </div>\r\n      </ui-container>\r\n    </ui-content>\r\n  </ui-page>\r\n</template>\r\n"; });
